INSERT INTO youtube_data VALUES(974,'wTF6vzS9fy4','K Nearest Neighbour Easily Explained with Implementation',replace('In pattern recognition, the k-nearest neighbors algorithm (k-NN) is a non-parametric method used for classification and regression.[1] In both cases, the input consists of the k closest training examples in the feature space. The output depends on whether k-NN is used for classification or regression:\n\nIn k-NN classification, the output is a class membership. An object is classified by a plurality vote of its neighbors, with the object being assigned to the class most common among its k nearest neighbors (k is a positive integer, typically small). If k = 1, then the object is simply assigned to the class of that single nearest neighbor.\nIn k-NN regression, the output is the property value for the object. This value is the average of the values of k nearest neighbors.\nk-NN is a type of instance-based learning, or lazy learning, where the function is only approximated locally and all computation is deferred until classification. The k-NN algorithm is among the simplest of all machine learning algorithms.\n\nBoth for classification and regression, a useful technique can be used to assign weight to the contributions of the neighbors, so that the nearer neighbors contribute more to the average than the more distant ones. For example, a common weighting scheme consists in giving each neighbor a weight of 1/d, where d is the distance to the neighbor.\n\nReferences : Jose Portilla Project Implementation. This video is dedicated to him. thank you for serving the community\n\ngithub url: https://github.com/krishnaik06/K-Nearest-Neighour\n\nYou can buy my book on Finance with ML and DL using python from the below link\n\namazon url: https://www.amazon.in/Hands-Python-Finance-implementing-strategies/dp/1789346371/ref=sr_1_1?keywords=Krish+naik&qid=1560843206&s=gateway&sr=8-1','\n',char(10)),'2019-06-18T13:03:24Z',8,'[''k nearest neighbour algorithm ppt'', ''k nearest neighbor python'', ''k nearest neighbor c++ source code'', ''discuss k nearest neighbour classification algorithm and characteristics with example'', ''k-nearest neighbor algorithm example python'', ''k nearest neighbor in r'', ''knn algorithm tutorialspoint'', ''knn algorithm pseudocode'']','{''viewCount'': ''80440'', ''likeCount'': ''1527'', ''dislikeCount'': ''46'', ''favoriteCount'': ''0'', ''commentCount'': ''60''}',80455,1528,46,60,56,1633,80455,7.1838028483414442248,'Very Good');
INSERT INTO youtube_data VALUES(975,'fJOhLKvWOJI','How to Visualize Multiple Linear Regression in python',replace('Multiple Linear Regression is similar to simple linear regression but the major difference being that we try to establish linear relationship between one response variable and more than one predictor variables. For example suppose that a researcher is studying that how the housing prices are affected by area of the apartment and the demand supply gap in that region. The response variable is apartment price (Y) and the predictor variables are area of apartment (X1) and demand supply gap (X2).\n\ngithub link:  https://github.com/krishnaik06/Visualize-Multiple-Linear-Regression\n\nYou can buy my book on Finance with ML and DL using python from the below link\n\namazon url: https://www.amazon.in/Hands-Python-Finance-implementing-strategies/dp/1789346371/ref=sr_1_1?keywords=Krish+naik&qid=1560843206&s=gateway&sr=8-1','\n',char(10)),'2019-06-18T07:40:18Z',6,'[''multiple linear regression python sklearn example'', ''multiple linear regression in python from scratch'', ''python linear regression pandas'', ''3d linear regression python'', ''multiple linear regression machine learning python'', ''linear regression projects in python'']','{''viewCount'': ''15649'', ''likeCount'': ''172'', ''dislikeCount'': ''15'', ''favoriteCount'': ''0'', ''commentCount'': ''12''}',15649,172,15,12,53,199,15649,1.3972945220768784313,'Very Good');
INSERT INTO youtube_data VALUES(976,'CSEmUmkfb8Q','Deployment of Deep Learning Model using Flask',replace('Flask is a micro web framework written in Python. It is classified as a microframework because it does not require particular tools or libraries.[3] It has no database abstraction layer, form validation, or any other components where pre-existing third-party libraries provide common functions. However, Flask supports extensions that can add application features as if they were implemented in Flask itself. Extensions exist for object-relational mappers, form validation, upload handling, various open authentication technologies and several common framework related tools. Extensions are updated far more regularly than the core Flask program.\n\n#FlaskDeepLearningModelDeployment\n\ngithub url: https://github.com/krishnaik06/Deployment-Deep-Learning-Model\n\nYou can buy my book where I have provided a detailed explanation of how we can use Machine Learning, Deep Learning in Finance using python\n\nurl:  https://www.amazon.in/Hands-Python-Finance-implementing-strategies/dp/1789346371/ref=sr_1_1?keywords=krish+naik&qid=1560675332&s=gateway&sr=8-1','\n',char(10)),'2019-06-17T17:13:32Z',8,'[''using flask to serve a machine learning model as a restful web service'', ''flask machine learning app'', ''deploy machine learning model python'', ''deploy machine learning model django'', ''embedding a machine learning model into a web application'', ''deploy machine learning models in production as apis'', ''how to deploy keras models to production'', ''deploy ml model using flask'']','{''viewCount'': ''36087'', ''likeCount'': ''645'', ''dislikeCount'': ''15'', ''favoriteCount'': ''0'', ''commentCount'': ''84''}',36092,645,15,84,45,744,36092,3.2226438680298228334,'Very Good');
